
DROP TABLE IF EXISTS `par`;
CREATE TABLE `par` (
  `tancid` int(11) NOT NULL,
  `ferfiid` int(11) NOT NULL,
  `noid` int(11) NOT NULL
) ;


DROP TABLE IF EXISTS `tag`;
CREATE TABLE `tag` (
  `id` int(11) NOT NULL,
  `nev` varchar(100) COLLATE utf8_hungarian_ci NOT NULL,
  `ferfi` tinyint(1) NOT NULL,
  `szulido` date NOT NULL
) ;


DROP TABLE IF EXISTS `tanc`;
CREATE TABLE `tanc` (
  `id` int(11) NOT NULL,
  `datum` date NOT NULL,
  `nev` varchar(100) COLLATE utf8_hungarian_ci NOT NULL
) ;



ALTER TABLE `tag`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `tanc`
  ADD PRIMARY KEY (`id`);